import Layout from "../components/Layout";
import Resume from "../components/Resume";

export default () => (
  <Layout className="layout">
    <Resume />
    <style jsx>
      {`
        @media print {
          .layout {
            display: none;
          }
        }
      `}
    </style>
  </Layout>
);
